import React from 'react';

const Sidebar = ({ isOpen, onToggleSidebar }) => {
  return (
    <aside className={`sidebar ${isOpen ? 'open' : ''}`}>
      <ul className="menu">
        <li className="menu-item"><i className="fa fa-home"></i> Home</li> 
        <li className="menu-item"><i className="fa fa-chart-bar"></i> Crop Market</li> 
        <li className="menu-item"><i className="fa fa-building"></i> Govt. P&S</li> 
        <li className="menu-item"><i className="fa fa-cogs"></i> Services</li> 
        <li className="menu-item"><i className="fa fa-shopping-cart"></i> Products</li> 
        <li className="menu-item"><i className="fa fa-phone"></i> Contact</li> 
        <li className="menu-item"><i className="fa fa-info-circle"></i> About Us</li> 
        <li className="menu-item"><i className="fa fa-cloud"></i> Weather</li> 
        <li className="menu-item"><i className="fa fa-question-circle"></i> Help</li> 
      </ul>
    </aside>
  );
};

export default Sidebar;
